export const StockContextProvider= (props) => {
    return (

        <li className="stock-item">
             <button className="dlt-stock" onClick={() => deleteStock(props.id)}>x</button>{props.symbol}<span className="stock-price">${props.price}</span><span>{props.shares}</span><span>${props.price*props.share}</span>

       </li>
    )
}
